window.bookSummaryJSON = "<p>The number one <i>New York Times</i> best-selling series finale and sequel to <i>A Discovery of Witches</i> and <i>Shadow of Night</i>.</p> <p>Look for the hit TV series <i>A Discovery of Witches</i>, streaming on AMC Plus, Sundance Now, and Shudder.</p> <p>Bringing the magic and suspense of the All Souls Trilogy to a deeply satisfying conclusion, this highly anticipated finale went straight to number one on the <i>New York Times</i> best seller list. In <i>The Book of Life</i>, Diana and Matthew time-travel back from Elizabethan London to make a dramatic return to the present - facing new crises and old enemies. At Matthew’s ancestral home, Sept-Tours, they reunite with the beloved cast of characters from <i>A Discovery of Witches</i> - with one significant exception. But the real threat to their future has yet to be revealed, and when it is, the search for Ashmole 782 and its missing pages takes on even more urgency.</p>"; 
